import 'bootstrap/dist/css/bootstrap.min.css';
import './css/Navbar.css';
import { Button } from 'bootstrap';
import Logo from '../../Assets/Img_Home/Logo.png';
import React, { useState } from 'react';
import './Menu.js'

const NavBar = () =>{

    const [menuVisible, setMenuVisible] = useState(false);

  const toggleMenu = () => {
    setMenuVisible(!menuVisible); // Alterna entre visible y no visible
  };

    return(
        <header>
        <img class="logo" src="imagen/logo.png" alt="InnoVenta Logo" />
        <button id="abrir" class="abrir-menu"><i class="bi bi-list"></i></button>
        <nav class="nav-1" id="nav-1">
            <button id="cerrar" class="cerrar-menu"><i class="bi bi-x-circle"></i></button>
            <ul class="nav-list">
                <li><a href="#">Inicio</a></li>
                <li><a href="#">Membresia</a></li>
                <li><a href="#">Productos</a></li>
                <li><a href="#">Contacto</a></li>
            </ul>
        </nav>
        <button href="#comenzar" class="fondo-boton letra-boton desactivacion-boton">Comenzar</button>
    </header>
    
    )
};

export default NavBar;
